Starring
Ariella Ferrera &amp; Ela Darling, Alyssa Reece &amp; Elexis Monroe, Sophia Jade &amp; Annabelle Lee, Andy San Dimas &amp; Veronica Snow.

Description
Forbidden desires and undiscovered passions fuel the lust of eight gorgeous lesbians in Girl Candy Films' Deep Kissing Lesbians, Volume 2. From predatory professor Veronica Snow's lust for student Andy San Dimas, to slender blonde Ela Darling's fiery passion for busty Ariella Ferrera, these lesbians crave long, deep kisses from the soft, supple mouth of another woman.
Written and Directed by Nica Noelle
